import React, { useState } from "react";
import "./Carousel.css";
import { images } from "../Components/CarouselData";

function Item() {
  const { images } = this.state;
  return (
    <div className="Carousel">
      <div className="carouselInner">
        <img src={images.map((imges) => image)} />
      </div>
    </div>
  );
}
export default Item;
